import React from 'react';

const EventsList = () => {
  return (
    <div className="events-container">
      <h2>Active Events</h2>
      <ul>
        <li>Science Fest</li>
        <li>Tech Fest</li>
        {/* Add more events here */}
      </ul>
    </div>
  );
};

export default EventsList;
